---
export type Props = {
  fill: string;
  size: string;
  stroke: string;
};

const { fill, size, stroke } = Astro.props;
---

<svg
  height={size}
  version="1.1"
  viewBox="0 0 64 64"
  width={size}
  xmlns:xlink="http://www.w3.org/1999/xlink"
  xmlns="http://www.w3.org/2000/svg"
>
  <path
    d="M3,31a29,29 0 1,1 0,2zm17-4h24m0,11H20"
    {fill}
    stroke-width="6"
    stroke={stroke}></path>
</svg>
